	(227, 49, 'event_reviewer', 'John Defore, The Hollywood Reporter '),
	(228, 49, '_event_reviewer', 'field_5bd5ece280dec'),
	(229, 49, 'event_review', 'Smart, stylish doc exposes must-discuss issues regarding the companies who dominate the Internet'),
	(230, 49, '_event_review', 'field_5bd5ecf780ded'),
	(231, 49, 'event_full', 'In an unmarked office building in Manila, just about as far away from Silicon Valley as you can get, a hidden industry has emerged.  They are online moderators and their job is to scour through all of our personal online content and decide whether to skip over it or delete it from view.  However, beyond this invasion of our not-so-private lives, these workers must also trawl through all of the most disturbing content hidden in the darkest corners of the internet.Bravely and anonymously, these “cleaners” speak out about their jobs, the industry and the impact moderating this content has on their psychological well-being.  And at the other end of the line, the tech companies outsourcing the moderating of this content are called into question.  What are their commercial imperatives?  And who is moderating the moderators?                                                    Hans Block and Moritz Riesewieck’s documentary offers a complex and well-rounded view of censorship going well beyond knee-jerk reactions and in doing so paints a picture of the social media landscape with the darkest of hues.\r\n'),
	(232, 49, '_event_full', 'field_5bd5ed0780dee'),
