	(288, 29, '_event_reviewer', 'field_5bd5ece280dec'),
	(289, 29, 'event_review', '…the power of the film is undeniable.'),
	(290, 29, '_event_review', 'field_5bd5ecf780ded'),
	(291, 29, 'event_full', 'Marish has been exploited and abused for more than 10 years by the woman for whom she toils as a housekeeper—entirely unpaid. She even has to hand over the money she earns with an extra job as a cleaner in a factory. She’s forbidden to do anything without permission. Marish’s 18-year-old daughter couldn’t stand it anymore and ran away a couple of years ago, but Marish lives with too much fear in her heart. Can she ever learn to trust people again? She dreams of seeing her daughter again but will she find the courage to take a step forward in her life?\r\n'),
	(292, 29, '_event_full', 'field_5bd5ed0780dee'),
