	(312, 60, '_event_reviewer', 'field_5bd5ece280dec'),
	(313, 60, 'event_review', 'A heartwarming film and a reminder that welcoming is the most powerful tool we have'),
	(314, 60, '_event_review', 'field_5bd5ecf780ded'),
	(315, 60, 'event_full', 'Constance is a strong Acholi woman who was one of the first refugees from South Sudan to settle in Wagga Wagga with her family in 2005. A third generation refugee, victim of war crimes, a survivor, single mother, community leader and activist; Constance is charismatic, although troubled. Filmed over ten years, honest interviews are complemented by animated sequences and archive footage that pulls together this family’s story of navigating a challenging settlement journey in Australia, after fleeing civil war abroad. Hope flourishes for their future in this story about the importance of community and sense of agency in those who must rebuild.\r\n'),
	(316, 60, '_event_full', 'field_5bd5ed0780dee'),
