	(336, 61, '_event_reviewer', 'field_5bd5ece280dec'),
	(337, 61, 'event_review', 'This doc celebrates that momentous day- and with fascinating depth, profiles the LGBT heroes that worked tirelessly for decades to make the dream of marrage equality a reality'),
	(338, 61, '_event_review', 'field_5bd5ecf780ded'),
	(339, 61, 'event_full', 'June 26, 2015, former US President Barack Obama declared, “Our nation was founded on a bedrock principle that we are all created equal”. One of the most successful civil rights movements in modern history, the ‘Freedom to Marry’ campaign was fought over decades. This heart-warming documentary chronicles the historic movement to the US Supreme Court and the landmark ruling for marriage equality. We watch as lawyer Evan Wolfson (leader of the ‘Freedom to Marry’ movement) and counsel for GLAD (Gay and Lesbian Advocates and Defenders) Mary Bonauto, amongst many dedicated and inexhaustible advocates, turn opponents of same sex marriage into supporters.\r\n'),
	(340, 61, '_event_full', 'field_5bd5ed0780dee'),
