	(360, 62, '_event_reviewer', 'field_5bd5ece280dec'),
	(361, 62, 'event_review', 'Check It is consistently compelling, with a brisk pace and vivid personalities.'),
	(362, 62, '_event_review', 'field_5bd5ecf780ded'),
	(363, 62, 'event_full', 'Armed with Louis Vuitton bags and pink tasers, a group of black queer youth band together to fight back against the violence and prejudice they experience on the streets of Washington DC. With support from community leaders, flamboyant gang members Tray, Skittles and Day Day attempt to harness their creativity and passion into futures in fashion and professional boxing – a seemingly insurmountable task when prostitution and theft are typical means of survival. Directors Flor and Oppenheimer explore systemic oppression, identity, and self-determination in the colourful and dramatic resistance of these gay and genderqueer teenagers.\r\n'),
	(364, 62, '_event_full', 'field_5bd5ed0780dee'),
