	(405, 63, 'event_review', 'Academy Award®-nominated director Joe Berlinger takes an unwavering look at the Armenian genocide after a century of denial by the Turkish government and its strategic allies.'),
	(406, 63, '_event_review', 'field_5bd5ecf780ded'),
	(407, 63, 'event_full', 'Legendary documentarian Joe Berlinger’s (Metallica: Some Kind of Monster, Tony Robbins: I am Not Your Guru, Crude) thirteenth feature film, captures the cinematic and political challenges of producing a historically meaningful, big-budget film in an environment rife with political suppression. In 2015, Academy Award-winning director Terry George (Hotel Rwanda) took on the challenge of making the first mainstream film about the 1915 Armenian Genocide that wiped out 1.5 million Armenians in The Promise (starring Oscar Isaac and Christian Bale). Berlinger’s film combines a mixture of exclusive behind-the- scenes footage, rare archival material and investigative interviews that capture the shocking and complex history of the Armenian Genocide, all while presenting the unfolding, real-time drama of bringing this long-ignored chapter of human cruelty to the big screen.\r\n'),
	(408, 63, '_event_full', 'field_5bd5ed0780dee'),
