	(430, 74, '_event_review', 'field_5bd5ecf780ded'),
	(431, 74, 'event_full', 'Raw and exhilarating, Raving Iran follows DJ’s Anoosh and Arash (aka Blade & Beard) as they try to pursue their musical dreams in a society where techno is severely forbidden. Regularly dodging the moral police and incarceration, they live in constant fear of serious persecution for their passion. However, when they receive an invitation to perform at Lethargy Techno festival in Zurich, an opportunity arrives for them to create a new life for themselves in Europe. But are they willing to sacrifice their whole world for creative freedom? Featuring the unique stylings of Persian House and rare footage of underground desert raves, Raving Iran captures two men and a decision that will change their lives forever.\r\n'),
