	(454, 75, '_event_review', 'field_5bd5ecf780ded'),
	(455, 75, 'event_full', 'Critics favourite at this year’s Sundance Film Festival, Quest provides profound illumination into race, class and community through an intimate portrait of the Rainey family in North Philadelphia. Despite their own individual hardships, Christopher ‘Quest’ Rainey and his wife Christine ‘Ma Quest’, not only provide support and sanctuary for their family, but also to the greater community within their home music studio. Shot over nearly a decade, we witness the joys and unforeseeable turmoil this family encounters and ultimately overcomes with bravery and humility. Jonathan Olshefski’s stunning feature debut shows the simple beauty and necessity of human kindness at a crucial time in a country’s history, when it’s needed more than ever.\r\n'),
	(456, 75, '_event_full', 'field_5bd5ed0780dee'),
