	(478, 76, '_event_review', 'field_5bd5ecf780ded'),
	(479, 76, 'event_full', 'Café Waldluft is not what it used to be. Once a popular tourist destination, nestled in the picturesque mountain town of Berchtesgaden, Flora Kurz’s rustic hotel today exclusively welcomes refugees from across the globe. For each inhabitant, her hotel offers the hope of a new beginning, the aspiration of a new home – but with the myriad emotional and bureaucratic obstacles in their way, what does it take for them to arrive for good? This heartfelt and kind documentary takes an intimate look at the intersecting lives of the refugee residents, tourists and locals. Café Waldluft offers an important vision of empathy in the ongoing refugee crisis.\r\n'),
