	(502, 77, '_event_review', 'field_5bd5ecf780ded'),
	(503, 77, 'event_full', 'Steeped in a legal dispute that prevented its release, The Opposition details the struggle of 3,000 residents of the Paga Hill community in Papua New Guinea who watched helplessly as police bulldozed their homes to make way for a luxury resort. Two community leaders rose to help, but were driven down different paths in their individual pursuit for justice. Australian director Hollie Fifer’s pursuit of the truth, wherever it led, prompted one subject to file an injunction against the film’s release. Right triumphing over might never seemed so daunting. Film introduction by director Hollie Fifer and protagonist Joe Moses.\r\n'),
