	(527, 78, 'event_full', 'Based on the award-winning cult novel by James St James and in the vein of CLUELESS and NAPOLEON DYNAMITE, FREAK SHOW tells the moving, heartbreaking and hilarious story of Billy Bloom, a boldly confident and eccentric teenager who faces intolerance and persecution at his ultra conservative high school, and decides to fight back on behalf of all the misunderstood freaks of the world.\r\n'),
