	(548, 79, '_event_reviewer', 'field_5bd5ece280dec'),
	(549, 79, 'event_review', 'WONDER is that rare thing, a family picture that moves and amuses while never overly pandering.'),
	(550, 79, '_event_review', 'field_5bd5ecf780ded'),
	(551, 79, 'event_full', 'Based on the New York Times bestseller, WONDER tells the inspiring and heartwarming story of August Pullman. Born with facial differences that, up until now, have prevented him from going to a mainstream school, Auggie becomes the most unlikely of heroes when he enters the local fifth grade. As his family, his new classmates, and the larger community all struggle to find their compassion and acceptance, Auggie’s extraordinary journey will unite them all and prove you can’t blend in when you were born to stand out.\r\n'),
	(552, 79, '_event_full', 'field_5bd5ed0780dee'),
