	(603, 81, '_event_review', 'field_5bd5ecf780ded'),
	(604, 81, 'event_full', '“I’m not black. I’m not white. I’m sort of in the middle.” Zach Doomadgee is an Indigenous Australian teenager in Sydney torn between two worlds. On the cusp of manhood, Zach tries to navigate his way between urban modernity and ancient cultural heritage, but doesn’t feel accepted in either space. As his 16th birthday approaches, his dedicated but domineering father helps him prepare for Ceremony – the ancient initiation rite for men in their family – hoping to provide Zach with the guidance and assurance he is seeking. Shot over the course of 5 years, this coming-of-age film brings to light the issues of identity and belonging felt by many Indigenous adolescents today.'),
	(605, 81, '_event_full', 'field_5bd5ed0780dee');
